import React from "react";
import "./Contact.css";


const Contact = () => {
    return (
        <div className="contact-container">
            <video>
                <source src="https://www.youtube.com/watch?v=9bZkp7q19f0" type="video/mp4" />
            </video>

        </div>
    );
}
export default Contact;
